import React from 'react';
import { withRouter } from "react-router-dom";
import Teclado from "./piano";

function Xmaspiano() {
  return (
    <>
     {/* notes in top div */}
     <div className="container">

     <div className="top">
        Top
      </div>

      <div className="bottom">
        <Teclado className="PianoDarkTheme" />
      </div>


    </div>
    </>
  );
}

export default withRouter(Xmaspiano);
